import {Legend,LineChart, Line, Label, CartesianGrid, ResponsiveContainer, XAxis, YAxis, Tooltip } from 'recharts';
import Stack from '@mui/material/Stack';
import './AppStyle.css'
import notiFied from './notifications.json'

const dataCrime= [
    {
      name: 'Mon',
      uv: 4000,
      pv: 2400,
      amt: 2400,
    },
    {
      name: 'Tues',
      uv: 3000,
      pv: 1398,
      amt: 2210,
    },
    {
      name: 'Wed',
      uv: 2000,
      pv: 9800,
      amt: 2290,
    },
    {
      name: 'Thurs',
      uv: 2780,
      pv: 3908,
      amt: 2000,
    },
    {
      name: 'Fri',
      uv: 1890,
      pv: 4800,
      amt: 2181,
    },
    {
      name: 'Sat',
      uv: 2390,
      pv: 3800,
      amt: 2500,
    },
    {
      name: 'Sun',
      uv: 3490,
      pv: 4300,
      amt: 2100,
    },
];


const dataInv = [
    {
      name: 'Mon',
      LI: "12"
    },
    {
      name: 'Tues',
      LI: "1"
    },
    {
      name: 'Wed',
      LI: "5"
    },
    {
      name: 'Thurs',
      LI: "2"
    },
    {
      name: 'Fri',
      LI: "7"
    },
    {
      name: 'Sat',
      LI: "0"
    },
    {
      name: 'Sun',
      LI: "1"
    },
];




function AdminMaster(){
    return( 
        <div>
            <GraphNotified/>      
        </div>
    )
}

function GraphNotified(){
    return(
        <div>
        <Stack spacing={2} direction="row" justifyContent="center" alignItems="center">

        <LineChart width={600} height={300} data={dataInv} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
          <Line type="monotone" dataKey="LI" stroke="#8884d8" name="Estimated Inventory Loss"/>
          <CartesianGrid stroke="#ccc" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
        </LineChart>
   
      

       
        <LineChart width={600} height={300} data={dataCrime} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
          <Line type="monotone" dataKey="uv" stroke="#8884d8" name="Estimated Crimes Detected"/>
          <CartesianGrid stroke="#ccc" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
        </LineChart>
  

        </Stack>
        
        <Stack spacing={2} direction="column" justifyContent="center" alignItems="center">
        <div id="autoScroll" className="buttonParent" style={{width: '1020px', height: '250px', overflowX: 'auto', whiteSpace: 'nowrap', textOverflow: 'ellipsis', scrollBehavior: 'smooth'}}>
        {notiFied.map((notiFied, index)=>{
              return(
              <h1>{notiFied.notification}</h1>
              )
            })}
            <p style={{textAlign: 'center', color: 'black'}}>Notification 1</p>
            <p style={{textAlign: 'center', color: 'black'}}>Notification 2</p>
            <p style={{textAlign: 'center', color: 'black'}}>Notification 3</p>
            <p style={{textAlign: 'center', color: 'black'}}>Notification 4</p>
            <p style={{textAlign: 'center', color: 'black'}}>Notification 5</p>
            <p style={{textAlign: 'center', color: 'black'}}>Notification 6</p>
        </div>
        </Stack>
        </div>
    )
}
//var elem = document.getElementById('autoScroll');
//elem.scrollTop = elem.scrollHeight;
  
export default AdminMaster;
